        Capacity:
            Cap_COCO:
                Count: 30
                Target: WJMSjmsCOCO
        MaxThreadsConstraint:
            MaxThreads_COCO:
                Count: 30
                Target: WJMSjmsCOCO
        MinThreadsConstraint:
            MinThreads_COCO:
                Count: 1
                Target: WJMSjmsCOCO
