            WM_COCO:
                MinThreadsConstraint: MinThreads_COCO
                MaxThreadsConstraint: MaxThreads_COCO
                Target: WJMSjmsCOCO
                Capacity: Cap_COCO
    WebAppContainer:
        ServletReloadCheckSecs: -1
    JDBCSystemResource:
        UJMS_TLCBAM_DS:
            Target: WJMSjmsWJMS
            JdbcResource:
                DatasourceType: GENERIC
                JDBCConnectionPoolParams:
                    InactiveConnectionTimeoutSeconds: 1200
                    TestConnectionsOnReserve: true
                    TestTableName: SQL SELECT 1 FROM DUAL
                JDBCDataSourceParams:
                    JNDIName: jdbc/UJMS_TLCBAM_DS
                    GlobalTransactionsProtocol: None
                JDBCDriverParams:
                    DriverName: oracle.jdbc.OracleDriver
                    PasswordEncrypted: '@@SECRET:@@ENV:DOMAIN_UID@@-jdbc-ujms-tlcbam-ds:password@@'
                    URL: '@@PROP:JDBC.UJMS_TLCBAM_DS.URL@@'
                    Properties:
                        user:
                            Value: '@@SECRET:@@ENV:DOMAIN_UID@@-jdbc-ujms-tlcbam-ds:username@@'
